func TestPrefixTable(t *testing.T) {
	for _, tv := range testVectors {
		res := isMaybeModernSigIDMakerModern(keybase1.SigIDBase(tv.sigID[0:64]))
		require.Equal(t, res, tv.isModern)
	}
}
